import React from 'react';
import './styles/MakeupList.css';

const makeupStyles = [
    {
        name: "Classic Bridal Look",
        description: "A timeless look with soft pinks and golds, perfect for the traditional bride.",
        imageUrl: "/images/bridal-look.jpg",
    },
    {
        name: "Glamorous Evening Look",
        description: "Bold eyes with smokey shadows and red lips, ideal for a cocktail party.",
        imageUrl: "/images/evening-look.jpg",
    },
    {
        name: "Natural Office Look",
        description: "Subtle and polished with neutral tones, great for a professional environment.",
        imageUrl: "/images/office-look.jpg",
    },
    {
        name: "No Makeup Look",
        description: "Enhance your natural beauty with minimal makeup, perfect for a casual day out.",
        imageUrl: "/images/no-makeup-look.jpg",
    },
    {
        name: "Festive Look",
        description: "Bright and colorful with a touch of sparkle, ideal for festive celebrations.",
        imageUrl: "/images/festive-look.jpg",
    },
];

function MakeupList() {
    return (
        <div className="makeup-list-container">
            <h2 className="text-center">Makeup Styles for the Occasion</h2>
            <div className="makeup-grid">
                {makeupStyles.map((style, index) => (
                    <div key={index} className="makeup-box">
                        <img src={style.imageUrl} alt={style.name} className="makeup-image" />
                        <div className="makeup-info">
                            <h3 className="makeup-title">{style.name}</h3>
                            <p className="makeup-description">{style.description}</p>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default MakeupList;
